import { connect } from 'react-redux';
import { bindActionCreators } from "redux";
import { get as _get } from "lodash";
import UserProfile from './UserProfile';

import { getProductList ,getSearchProductList, resetSearchProductList} from '../../Store/action/product'
import { showToastMessage, setStartLoader, setStopLoader, resetToastMessage } from '../../Store/action/loader'
import { openLogin, closeLogin } from '../../Store/action/login';
import { logoutUser,resetUserProfile,clearCartData } from '../../Store/action/user'

function mapStateToProps(state, props) {
    return {
        showLogin : state.login.showLogin,
        userLocationName : state.location.userLocationName,
        userProfile:_get(state,'user.userProfile',null),
        cartCount: state.product.addToCart ? state.product.addToCart.products.length : 0,
        addToCart: state.product.addToCart,
        searchProductList: _get(state,'product.searchProductSuccess',[])
    };
}

function mapDispatchToProps(dispatch) {
    return bindActionCreators({
        getProductList,
        showToastMessage,
        setStartLoader, 
        setStopLoader,
        resetToastMessage,
        openLogin,
        closeLogin,
        logoutUser,
        resetUserProfile,
        clearCartData,
        getSearchProductList,
        resetSearchProductList
    }, dispatch);
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(UserProfile);
